--Creating ERP Tables
create table erpCountries
(
countryId char(2) primary key,
countryName varchar(50),
countryMarket varchar(50)
)

create table erpPeople
(
personId int primary key,
personFullName nvarchar(50),
personEmail varchar(50)
)

create table erpSaleMenager
(
personId int primary key references erpPeople(personId)
)

create table erpItems
(
itemNumber nvarchar(50) primary key,
itemDescription nvarchar(100),
productFamilyId varchar(50)
)

create table erpCustomers
(
customerNumber int primary key,
customerName nvarchar(50),
isLocal bit,
saleMenagerId int,
countryId char(2)
)

create table erpSales
(
saleDate date,
customerNumber int,
itemNumber nvarchar(50),
qty float,

primary key(saleDate,customerNumber, itemNumber)
)

create table erpWeeks
(
yearP int,
quarterP int,
weekNumber int,
actualProduction float,
actualGreens float,
actualSales float,
actualInventory float,
actualInventoryS float,
actualInventoryN float,
actualInventoryD float,
actualInventoryE float,
actualInventoryOF float,
actualInventoryExternal float,

primary key(yearP,quarterP,weekNumber)
)

